
CREATE TABLE `chapter_list` (
  `id` int NOT NULL AUTO_INCREMENT,
  `manga_id` int NOT NULL,
  `chapter_number` int NOT NULL,
  `title` varchar(50) NOT NULL,
  `number_of_page` int NOT NULL,
  `time_uploaded` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `manga_id` (`manga_id`),
  CONSTRAINT `chapter_list_ibfk_1` FOREIGN KEY (`manga_id`) REFERENCES `manga` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1194 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci

